import React from 'react'

const Song = (props) => {
    console.log(props)
    return (
        <div className="song-wrapper">
            <img src="{props.cover" alt="" className="musicCover"/>
            <h1>{props.name}</h1>
            <h1>{props.artist}</h1>

        </div>
    )
}

export default Song
